function drawBoundingBox(n,t){var r=document.getElementById(n),i=r.getContext("2d");i.strokeStyle="red";i.beginPath();i.moveTo(t.x1*320/1024,t.y1*240/768);i.lineTo(t.x2*320/1024,t.y1*240/768);i.lineTo(t.x2*320/1024,t.y2*240/768);i.lineTo(t.x1*320/1024,t.y2*240/768);i.lineTo(t.x1*320/1024,t.y1*240/768);i.stroke()}